import './App.css';


import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';

import {  BrowserRouter as Router,  Routes,  Route} from "react-router-dom";


export default class App extends Component {
  name = "saket";
  render() {

    return (
      <div>
        <Router>
        <Navbar/>
            <Routes>

              <Route exact path='/' element=          {<News pageSize = {5} category = "general" country="in" />}/>
              <Route exact path='/general' element =  {<News pageSize = {5} category = "general" country="in" />}/>     
              <Route exact path='/business' element=     {<News pageSize = {5} category = "business" country="in" />} />
              <Route exact path='/entertainment'element ={<News pageSize = {5} category = "entertainment" country="in"/>}/>
              <Route exact path='/health' element =      {<News pageSize = {5} category = "health" country="in" />}/>
              <Route exact path='/science'  element ={<News pageSize = {5} category = "science" country="in" />}/>
              <Route exact path='/sports' element ={<News pageSize = {5} category = "sports" country="in" />}/>
              <Route exact path='/technology' element = {<News pageSize = {5} category = "technology" country="in" />}/>

            </Routes>
        </Router>
      </div>
    )
  }
}
